window.bookSummaryJSON = "<p><b>Win the trials, earn a crown—or fail and lose everything.</b></p> <p>The heir of Embermere has unexpectedly died, and now a new prince and princess must be crowned.</p> <p>I've been hiding out with the dragons, but then mysterious fae show up at the dragons' stronghold and abduct me at the King's command.</p> <p>The royals of Embermere are hosting the Fae Heir Trials to find their successors. The winners will marry and become the next to rule the fae lands. Turns out I'm the King's illegitimate daughter, and the wicked queen intends to kill me off during the challenges.</p> <p>I find myself thrust into a barbaric tournament where death is all but guaranteed. I'm competing against the most gorgeous, deadly fae warriors of the realm. Determined, agile men who've been training to claim this chance all their lives—including clan leader Rush Vega.</p> <p>Rush Vega is the Crown's favorite, devastatingly charming and dangerously tempting. His combat skills and dark secrets will be my undoing. With my survival on the line, my heart must resist his pull and those intriguing moonlight eyes. He's the queen's spy, and that makes him my number one enemy.</p> <p>My life might have become a game of savage brutality, but the Queen of Embermere underestimated me.</p> <p>I was born a fighter. And I intend to win.</p>"; 
